import {
    fetchCompForm,
    clearCompForm,
    makeOrderRequestAC,
} from './actions'

const makeOrderRequest = (form) => (dispatch, getState) => {
    const data = {
        alias: getState().compOrderForm.alias,
        ...form
    }

    const res = dispatch(makeOrderRequestAC(data))
    res.then(res => {
        console.log(res)
    }, err => {
        console.log(err)
    })
}

export {
    fetchCompForm,
    clearCompForm,
    makeOrderRequest
}
